import React, { useEffect, useState } from "react";
//const Initialstate = {name:""};
const Maincard = () => {
  const [todos, setTodos] = useState({});
  useEffect(() => {
    fetch(`https://api.tvmaze.com/shows`)
    .then(response=> response.json())
    .then(data=> setTodos(data) )
  }, []);

//console.log(todos);    
  return (
    
        <>
        <h1>{todos}</h1>
        </>
    
  );
};
export default Maincard;
